export default function TodoList({ items, onChange }) {
  return items.map(({ key, title, archived }, index) => <div className='todo-row' key={ key }>
    { span }
    <input
      className='todo-checked'
      type={ 'checkbox' }
      checked={ archived }
      onChange={ (e) => {
        onChange({
          key, title, archived: e.target.checked,
        }, index)
      } }
    />

  </div>)
}
